import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {getOrders} from './api';

export default function Profile() {
  const navigate = useNavigate();

  const goToHome = () => {
    navigate('/'); // Путь к странице Cart.js
  };
  const goToCart = () => {
    navigate('/cart'); // Путь к странице 
  };
const Orders = () => {
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    const fetchUsers = async () => {
      const ordersData = await getOrders();
      setOrders(ordersData);
    };
    fetchUsers();
  }, []);};
  return (
    <div>
      <h1 className='heading'>Профиль пользователя</h1>
      <h2>Имя пользователя:</h2>
      <div className='container'>
        <div class="buttons-profile">
          <button onClick={goToCart}>
            Новый заказ
          </button>
        </div>
      <ul>
        {orders.map(order => (
          <li key={order.orderid}>{order.medicineid}</li>
        ))}
      </ul>
      </div>
      <div class="navbar">
        <div class="thq-navbar-nav">
          <span>© Здоровье в корзине </span>
          <button className='back' onClick={goToHome}>
            Выйти
          </button>
        </div>
      </div>
    </div>
  )
}
